description:
One Week (2008)  

Canada
Drama / Roadmovie
94 minuten

geregisseerd door Michael McGowan
met Joshua Jackson, Liane Balaban en Campbell Scott

De ongeneeslijk zieke Ben besluit voor hij gaat trouwen een toer op zijn motor te maken; van Toronto naar Tofino. Hij stopt op verschillende plaatsen en hoopt in deze tijd achter de zin van het leven te kunnen komen.


